--  DDL for View VW_TSS_NFINC_RMA
--------------------------------------------------------

  CREATE OR REPLACE FORCE EDITIONABLE VIEW "LEPTM"."VW_TSS_NFINC_RMA" ("RET_NF_NO", "RET_NF_SERIE", "CNPJ_SHIP_TO", "DO", "NF_ORIG", "RMA") AS 
  SELECT 
W.NF_RETURN_NO RET_NF_NO ,W.NF_RETURN_SERIE RET_NF_SERIE, O.UDF6 CNPJ_SHIP_TO, W.ORDER_NO DO , N.NF_EXT_NO NF_ORIG, W.AUTHORIZATION_CODE RMA
FROM WEB_RETURN_REQUEST W
INNER JOIN OD_ORDERS O ON W.ORDER_NO = O.ORDER_NO
LEFT JOIN NF_OD_ORDERS N ON N.DO_NO = W.ORDER_NO AND N.DELETE_YN = 'N';
REM INSERTING into LEPTM.VW_TSS_NFINC_RMA
SET DEFINE OFF;
